  assign Delay2_reg_next_re[3] = REGA_re_1[3];
  assign Delay2_reg_next_im[3] = REGA_im_1[3];
  assign Delay2_reg_next_re[4] = REGA_re_1[4];
  assign Delay2_reg_next_im[4] = REGA_im_1[4];
  assign Delay2_reg_next_re[5] = REGA_re_1[5];
  assign Delay2_reg_next_im[5] = REGA_im_1[5];



  Subsystem1 u_Subsystem1 (.clk(clk),
                           .reset(reset),
                           .enb(enb),
                           .DATA_A_re(Delay2_out1_re[5]),  // sfix16_En7
                           .DATA_A_im(Delay2_out1_im[5]),  // sfix16_En7
                           .DATA_B_re(For_Each_Subsystem_out2_re[5]),  // sfix16_En7
                           .DATA_B_im(For_Each_Subsystem_out2_im[5]),  // sfix16_En7
                           .COUNT(Delay4_out1[5]),  // ufix7
                           .ENA(ENA),
                           .Out1_re(Subsystem1_out1_re),  // sfix16_En7
                           .Out1_im(Subsystem1_out1_im),  // sfix16_En7
                           .Out2_re(Subsystem1_out2_re),  // sfix16_En7
                           .Out2_im(Subsystem1_out2_im)  // sfix16_En7
                           );

  assign Out1_re = Subsystem1_out1_re;

  assign Out1_im = Subsystem1_out1_im;

  assign Out2_re = Subsystem1_out2_re;

  assign Out2_im = Subsystem1_out2_im;

  assign Constant3_out1 = 8'b00000101;



  assign Relational_Operator_relop1 = HDL_Counter_out1 >= Constant3_out1;



  assign Constant2_out1 = 8'b10000100;



  assign Relational_Operator1_relop1 = HDL_Counter_out1 <= Constant2_out1;



  assign Constant8_out1 = 8'b11111101;



  assign Relational_Operator2_relop1 = HDL_Counter_out1 >= Constant8_out1;



  assign Constant6_out1 = 1'b1;



  always @(posedge clk or posedge reset)
    begin : Delay5_process
      if (reset == 1'b1) begin
        Delay5_bypass <= 1'b0;
        Delay5_reg <= 1'b0;
      end
      else begin
        if (enb_const_rate) begin
          if (Relational_Operator2_relop1) begin
            if (rst == 1'b1) begin
              Delay5_bypass <= 1'b0;
              Delay5_reg <= 1'b0;
            end
            else begin
              Delay5_bypass <= Delay5_bypass_next;
              Delay5_reg <= Constant6_out1;
            end
          end
        end
      end
    end

  assign Delay5_delay_out = (rst == 1'b1 ? 1'b0 :
              Delay5_reg);
  assign valid_1 = (Relational_Operator2_relop1 == 1'b1 ? Delay5_delay_out :
              Delay5_bypass);
  assign Delay5_bypass_next = Delay5_delay_out;



  always @(posedge clk or posedge reset)
    begin : Delay6_process
      if (reset == 1'b1) begin
        Delay6_bypass_delay <= 1'b0;
        Delay6_reg <= 1'b0;
      end
      else begin
        if (enb_const_rate && ENA) begin
          Delay6_bypass_delay <= Delay6_reg;
          Delay6_reg <= ENA;
        end
      end
    end

  assign valid_2 = (ENA == 1'b1 ? Delay6_reg :
              Delay6_bypass_delay);



  assign valid = valid_2 & (valid_1 & (Relational_Operator_relop1 & Relational_Operator1_relop1));



endmodule  // fft_sub1

